webpackJsonp([0x7b8f7c79fd4c0c00],{"./node_modules/json-loader/index.js!./.cache/json/python-powxy.json":function(e,o){e.exports={data:{markdownRemark:{html:'<p><code>pow(x, y, z)</code> is a built-in function in Python 3 to calculate <code>x</code> to the power <code>y</code>, and if <code>z</code> is present, returns <code>x</code> to the power <code>y</code> <a href="https://processing.org/reference/modulo.html">modulo</a> <code>z</code>.</p>\n<h2>Arguments</h2>\n<p>The arguments must have numeric types.<br>\nThis function takes two arguments, <code>x</code> and <code>y</code>, as well as three, <code>x</code>, <code>y</code>, and<code>z</code>.<br>\nIf <code>z</code> is present, <code>x</code> and <code>y</code> must be of integer types, and y must be non-negative.</p>\n<h2>Return</h2>\n<p>If <code>z</code> is present, it returns <code>x</code> to the power <code>y</code> modulo <code>z</code>. If only <code>x</code> and <code>y</code> are present, it returns <code>x</code> to the power <code>y</code> (same as <code>x**y</code>).</p>\n<h2>Example</h2>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>print(pow(2,4))    # prints 16\nprint(pow(10,-2))  # prints 0.01\nprint(pow(4,3,5))  # prints 4</code></pre>\n      </div>\n<p><img src="//forum.freecodecamp.com/images/emoji/emoji_one/rocket.png?v=2" title=":rocket:" alt=":rocket:" class="forum-image"> <a href=\'https://repl.it/CTGi\' target=\'_blank\' rel=\'nofollow\'>Run Code</a></p>\n<p><a href=\'https://docs.python.org/3/library/functions.html#pow\' target=\'_blank\' rel=\'nofollow\'>Official Documentation</a></p>',fields:{slug:"/python/powxy/"},frontmatter:{title:"Python Powxy"}}},pathContext:{slug:"/python/powxy/"}}}});
